import React, { useState, useRef } from 'react';
import { Clipboard, Upload } from 'lucide-react'; // ✅ For icons

const FileUpload = ({ handleSubmit, setImage, loading }) => {
  const [preview, setPreview] = useState(null);
  const [fileName, setFileName] = useState('');
  const fileInputRef = useRef(null);

  // ✅ Handle Drag and Drop
  const handleDrop = (e) => {
    e.preventDefault();
    const file = e.dataTransfer.files[0];
    if (file) handleFile(file);
  };

  // ✅ Handle File Selection
  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) handleFile(file);
  };

  // ✅ Handle File Paste
  const handlePaste = (e) => {
    const items = (e.clipboardData || e.originalEvent.clipboardData).items;
    for (const item of items) {
      if (item.kind === 'file') {
        const file = item.getAsFile();
        if (file) handleFile(file);
      }
    }
  };

  // ✅ Handle File from Clipboard using Clipboard API
  const handlePasteFromClipboard = async () => {
    try {
      const clipboardItems = await navigator.clipboard.read();
      for (const item of clipboardItems) {
        for (const type of item.types) {
          if (type.startsWith('image/')) {
            const blob = await item.getType(type);
            const file = new File([blob], 'pasted-image.png', { type });
            handleFile(file);
            return;
          }
        }
      }
      alert('No image found in clipboard!');
    } catch (error) {
      console.error('Error reading from clipboard:', error);
      alert('Clipboard access not supported or permission denied!');
    }
  };

  // ✅ Handle File
  const handleFile = (file) => {
    if (file) {
      setImage(file);
      setPreview(URL.createObjectURL(file));
      setFileName(file.name);
    }
  };

  // ✅ Trigger File Input on Click
  const handleClick = () => {
    fileInputRef.current.click();
  };

  return (
    <div 
      className="flex flex-col items-center relative" 
      onDragOver={(e) => e.preventDefault()} 
      onDrop={handleDrop}
      onPaste={handlePaste} // ✅ Handle paste event
    >
      {/* ✅ Drag and Drop Box */}
      <div
        className="border-2 border-dashed border-gray-400 rounded-md p-6 w-80 text-center cursor-pointer relative"
        onClick={handleClick}
      >
        {preview ? (
          <div className="relative">
            {/* ✅ Image Preview */}
            <img
              src={preview}
              alt="Preview"
              className="w-40 h-40 object-cover mx-auto rounded"
            />
            {/* ✅ Click to change */}
            <p className="text-gray-500 mt-2">Click to change</p>
          </div>
        ) : (
          <p className="text-gray-500">
            Drag & drop, <span className="font-semibold">paste</span>, or click to select an image
          </p>
        )}

        {/* ✅ Hidden File Input */}
        <input
          id="fileInput"
          type="file"
          accept="image/*"
          onChange={handleFileChange}
          className="hidden"
          ref={fileInputRef}
        />

        {/* ✅ Paste Icon Inside Drag and Drop */}
        <button
          onClick={handlePasteFromClipboard}
          className="absolute bottom-2 left-2 bg-gray-200 p-2 rounded-full hover:bg-gray-300 transition"
          title="Paste from clipboard"
        >
          <Clipboard className="w-5 h-5 text-gray-600" />
        </button>
      </div>

      {/* ✅ File Name */}
      {fileName && (
        <p className="text-gray-600 mt-2">
          Uploaded: <strong>{fileName}</strong>
        </p>
      )}

      {/* ✅ Submit Button */}
      <button
        onClick={handleSubmit}
        className={`mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 w-80 ${
          loading ? 'opacity-50 cursor-not-allowed' : ''
        }`}
        disabled={loading}
      >
        {loading ? 'Processing...' : 'Upload & Predict'}
      </button>
    </div>
  );
};

export default FileUpload;


